message:
[api] add @Extensible.cached_property; options bugfix

- make VisiData Extensible;
- options sheets are now cached_property so they can use other extensibles (like sorting)

Fix unit tests; default save name now hybrid

The default save name is sheet.source if it is a Path;
otherwise use <sheet.name>.tsv

[freqtbl] add HistogramColumn to allow overrides #1621

To replace the histogram function, use:

    @HistogramColumn.api
    def calcValue(col:Column, row) -> str:
        ...

[join-cols] options.value_joiner and name_joiner #550

Adds two options, which are strings:
- `value_joiner` to combine cell values for join-col;
- `name_joiner` to combine column names for join-col, and sheet names for dive-row;
  - sheet names for join-sheets are still joined with + or & for the time being

toplevel command() renamed to globalCommand()

- Sheet.command() removed;
- Sheet commands now at subclass scope: commands = [Command(...), ...]
